import React from 'react';
import './style.css';
import {Button} from '@material-ui/core';
import { Link } from 'react-router-dom';
import logo from './images/logo2.png';
import { makeStyles } from '@material-ui/core/styles';
import TextField from '@material-ui/core/TextField';

const Sign_in = () => {
    
  return (
    <div className="container1">
        <h1>Sign into CoralOS</h1>
        <p>Continue with the Google account or email address you use to sign in.</p>
        <Button className="button1" variant="outlined" ><img src={logo} /><span> &nbsp;Continue with Google</span></Button>
        <div className="Text1"><span>or</span></div>
        <form className="form2" noValidate autoComplete="off">
            <div className="field1"><TextField id="outlined-basic" label="Email Address" variant="outlined" /></div>
            <div className="field1"><TextField id="outlined-basic" label="Password" variant="outlined" /></div>
        </form>
        <div className="form-control">
          <label>hbdjkals</label>
          <input type='text' placeholder='vda' />
        </div>
        <div className="form-control">
          <label>hbdjkals</label>
          <input type='text' placeholder='vda' />
        </div>
      
        <div className="checkbox1">
          <input type='checkbox' />
          <label>Remember me</label>
        </div>
        <Button className="button2">Sign in</Button>
        <div className="linkdiv1">
            <Link to='/Sign_up'  className="link1">Forgot your password ?</Link>
            <br/>
            <Link to="/Sign_up" className="link2">Create an account</Link>
        </div>

    </div>
  );
};

export default Sign_in;
